import React from 'react';

import {
    Modal,
    ModalBody,
    ModalFooter,
    Carousel,
    CarouselItem,
    CarouselControl,
    CarouselIndicators,
    CarouselCaption,
    Button
} from 'reactstrap';

const items = [
    {
        src: 'data:image/png;base64,',
        altText: 'Выберите задание',
        caption: 'Каждое задание состоит в построчном разборе некоторой функции.'
    },
    {
        src: 'data:image/png;base64,',
        altText: 'Разберите функцию',
        caption: 'Строка разбора состоит из номера строки в исходной функции и её вычисленного значения.'
    },
    {
        src: 'data:image/png;base64,',
        altText: 'Преобразуйте значения',
        caption: 'Все значения переменных и условных операторов необходимо вычислить.'
    },
    {
        src: 'data:image/png;base64,',
        altText: 'Сохраняйте синтаксис',
        caption: 'Не забывайте ставить двоеточие после условных операторов, а также номера строк!'
    },
    {
        src: 'data:image/png;base64,',
        altText: 'Проверьте решение',
        caption: 'Нажмите на кнопку проверки и узнайте правильнось вашего решения.'
    },
    {
        src: 'data:image/png;base64,',
        altText: 'Статус решения',
        caption: 'Вы всегда можете увидеть статус вашего решения и номер ошибочной строки, а также количество решенных задач.'
    },
];
export default class Help extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            activeIndex: 0
        };

        this.next = this.next.bind(this);
        this.previous = this.previous.bind(this);
        this.goToIndex = this.goToIndex.bind(this);
        this.onExiting = this.onExiting.bind(this);
        this.onExited = this.onExited.bind(this);
    }

    onExiting() {
        this.animating = true;
    }

    onExited() {
        this.animating = false;
    }

    next() {
        if (this.animating) return;
        const nextIndex = this.state.activeIndex === items.length - 1 ? 0 : this.state.activeIndex + 1;
        this.setState({ activeIndex: nextIndex });
    }

    previous() {
        if (this.animating) return;
        const nextIndex = this.state.activeIndex === 0 ? items.length - 1 : this.state.activeIndex - 1;
        this.setState({ activeIndex: nextIndex });
    }

    goToIndex(newIndex) {
        if (this.animating) return;
        this.setState({ activeIndex: newIndex });
    }


    render() {

        const { activeIndex } = this.state;

        const slides = items.map((item, i) => {
            return (
                <CarouselItem
                    onExiting={this.onExiting}
                    onExited={this.onExited}
                    key={i}
                >
                    <img src={item.src} alt={item.altText} />
                    <CarouselCaption captionText={item.caption} captionHeader={item.altText} />
                </CarouselItem>
            );
        });

        return (
            <Modal isOpen={this.props.visible} onOpened={() => {this.setState({ activeIndex: 0 })}} className="tracer__help">
                <ModalBody>
                    <Carousel
                        activeIndex={activeIndex}
                        autoPlay={false}
                        interval={10000}
                        next={this.next}
                        previous={this.previous}
                    >
                        <CarouselIndicators items={items} activeIndex={activeIndex} onClickHandler={this.goToIndex} />
                        {slides}
                        <CarouselControl direction="prev" directionText="Previous" onClickHandler={this.previous} />
                        <CarouselControl direction="next" directionText="Next" onClickHandler={this.next} />
                    </Carousel>
                </ModalBody>
                <ModalFooter>
                    <Button onClick={this.props.onClose}>Назад</Button>
                </ModalFooter>
            </Modal>
        );
    }
}